    allowNull: false,
    unique: true
  },
  name: Sequelize.STRING,
  createdAt: {
    type: 'TIMESTAMP',
    defaultValue: Sequelize.literal('CURRENT_TIMESTAMP'),
    allowNull: false
  },
  updatedAt: {
    type: 'TIMESTAMP',
    defaultValue: Sequelize.literal('CURRENT_TIMESTAMP'),
    allowNull: false
  }
});

queryInterface.createTable('Classes', {
  classCode: { 
    type: Sequelize.STRING,
    allowNull: false,
    unique: true
  },
  name: Sequelize.STRING,
  createdAt: {
    type: 'TIMESTAMP',
    defaultValue: Sequelize.literal('CURRENT_TIMESTAMP'),
    allowNull: false
  },
  updatedAt: {
    type: 'TIMESTAMP',
    defaultValue: Sequelize.literal('CURRENT_TIMESTAMP'),
    allowNull: false
  }
});

queryInterface.createTable('Classrooms', { 
  classCode: { 
    type: Sequelize.STRING,
    allowNull: false,
    primaryKey: true
  },
  subjectCode: { 
    type: Sequelize.STRING,
    allowNull: false,
    primaryKey: true
  },
  tEmail1: { 
    type: Sequelize.STRING,
    allowNull: false,
    foreignKey: true
  },
  tEmail2: { 
    type: Sequelize.STRING,
    allowNull: true, 
  },
  sEmail: { 
    type: Sequelize.STRING,
    allowNull: false, 
    primaryKey: true
  },
  createdAt: {
    type: 'TIMESTAMP',
    defaultValue: Sequelize.literal('CURRENT_TIMESTAMP'),
    allowNull: false
  },
  updatedAt: {
    type: 'TIMESTAMP',
    defaultValue: Sequelize.literal('CURRENT_TIMESTAMP'),
    allowNull: false
  }
});

export default sequelize;

